import React from "react";

function Page(props) {
  const { page } = props;

  function clickHandler() {
    props.setSearchParams((state) => {
      return { ...state, page: page };
    });
  }

  return (
    <div>
      <button onClick={clickHandler}>{page}</button>
    </div>
  );
}

export default Page;
